def find_primes(a, b):
    """"""

    def is_prime(n):
        """Check if a number is prime"""
        if n <= 1:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True
    return [num for num in range(a, b + 1) if is_prime(num)]
